var linearTween=function(t,b,c,d){return c*t/d+b};var easeInQuad=function(t,b,c,d){t/=d;return c*t*t+b};var easeOutQuad=function(t,b,c,d){t/=d;return-c*t*(t-2)+b};var easeInOutQuad=function(t,b,c,d){t/=d/2;if(t<1)return c/2*t*t+b;t--;return-c/2*(t*(t-2)-1)+b};var easeInCubic=function(t,b,c,d){t/=d;return c*t*t*t+b};var easeOutCubic=function(t,b,c,d){t/=d;t--;return c*(t*t*t+1)+b};var easeInOutCubic=function(t,b,c,d){t/=d/2;if(t<1)return c/2*t*t*t+b;t-=2;return c/2*(t*t*t+2)+b};var easeInQuart=function(t,b,c,d){t/=d;return c*t*t*t*t+b};var easeOutQuart=function(t,b,c,d){t/=d;t--;return-c*(t*t*t*t-1)+b};var easeInOutQuart=function(t,b,c,d){t/=d/2;if(t<1)return c/2*t*t*t*t+b;t-=2;return-c/2*(t*t*t*t-2)+b};var easeInQuint=function(t,b,c,d){t/=d;return c*t*t*t*t*t+b};var easeOutQuint=function(t,b,c,d){t/=d;t--;return c*(t*t*t*t*t+1)+b};var easeInOutQuint=function(t,b,c,d){t/=d/2;if(t<1)return c/2*t*t*t*t*t+b;t-=2;return c/2*(t*t*t*t*t+2)+b};var easeInSine=function(t,b,c,d){return-c*Math.cos(t/d*(Math.PI/2))+c+b};var easeOutSine=function(t,b,c,d){return c*Math.sin(t/d*(Math.PI/2))+b};var easeInOutSine=function(t,b,c,d){return-c/2*(Math.cos(Math.PI*t/d)-1)+b};var easeInExpo=function(t,b,c,d){return c*Math.pow(2,10*(t/d-1))+b};var easeOutExpo=function(t,b,c,d){return c*(-Math.pow(2,-10*t/d)+1)+b};var easeInOutExpo=function(t,b,c,d){t/=d/2;if(t<1)return c/2*Math.pow(2,10*(t-1))+b;t--;return c/2*(-Math.pow(2,-10*t)+2)+b};var easeInCirc=function(t,b,c,d){t/=d;return-c*(Math.sqrt(1-t*t)-1)+b};var easeOutCirc=function(t,b,c,d){t/=d;t--;return c*Math.sqrt(1-t*t)+b};var easeInOutCirc=function(t,b,c,d){t/=d/2;if(t<1)return-c/2*(Math.sqrt(1-t*t)-1)+b;t-=2;return c/2*(Math.sqrt(1-t*t)+1)+b};